  false,\n\t\"url\": null,\n\t\"notes\": \"This data corresponds tp a proposed revision
  to the amount of critical habitat designated for the Preble's meadow jumping mouse
  in Colorado where it is listed as a threatened species under the Endangered Species
  Act (ESA). In total, the Service is proposing to designate approximately 418 miles
  of rivers and streams and 39,142 acres of adjacent habitat. The proposed revision
  would add an additional 184 miles of rivers and streams and 18,462 acres of adjacent
  habitat to the existing critical habitat designation in Colorado. The proposed revised
  critical habitat is located in Boulder, Broomfield, Douglas, El Paso, Jefferson,
  Larimer and Teller Counties.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
